import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import menus from '../../Lib/menu';

function NavBar() {
  return (
    <>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="#home">Colors</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            {
              menus.map((menu, id)=>{
                return (
                  menu.subMenu.length == 0 ?
                    <Nav.Link key={id} href={menu.path}>{menu.name}</Nav.Link>
                  :
                    <NavDropdown title={menu.name} id="collasible-nav-dropdown">
                      {
                        menu.subMenu.map((subMenu, key)=>{
                          return (
                            <div key={`${id}-${key}`}>
                              <NavDropdown.Item  href={subMenu.path}>{subMenu.name}</NavDropdown.Item>
                              <NavDropdown.Divider />
                            </div>
                          )
                        })
                      }
                    </NavDropdown> 
                )
              })
            }
            {/* <Nav.Link href="#features">Home</Nav.Link>
            <Nav.Link href="#pricing">About</Nav.Link> */}
            {/* <NavDropdown title="Contact" id="collasible-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Create</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                List
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Update</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Delete
              </NavDropdown.Item>
            </NavDropdown> */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </>
  );
}

export default NavBar;
